import React , { useState }  from 'react'
import fetch from 'isomorphic-unfetch'
import Cookies from 'js-cookie';

import { API } from '../config';


const Testpage = ({pokemon = [], token}) =>(

 
    <div>
       {console.log(pokemon.poke)}
       {console.log(token)}
      ss<h2>POKEMON FOREST  </h2>
       <ul>
        
           {pokemon.map(pokemon =>(
             <li key={pokemon.data.poke.id}>{pokemon.data.poke.id}</li>
            ))}

         
       </ul>
    </div>
)



Testpage.getInitialProps = fetchData;

async function fetchData() {
  
  const token = Cookies.get('token')
  const initialURL = `${API}/profile`;
  let config={
    headers:{
      'Accept': 'application/json',
      'Authorization': 'Bearer '+token
    }
   };
  
  const fetchRes = await fetch(initialURL, config)
  const res = await fetchRes.json()
  

  console.log(res.data)
  return {
    pokemon: res.data.poke,
    token
  }
}

  export default Testpage
